def findMaxConsecutiveOnes(nums):
    current_cnt = 0
    max_cnt = 0

    for num in nums:
        if num == 1:
            current_cnt = current_cnt + 1
            #if numbers==3323:
            #    print("numbers: ", numbers, "old_numbers:",old_numbers)
        else:
            max_cnt = max(current_cnt, max_cnt)
            current_cnt = 0
    max_cnt = max(current_cnt, max_cnt)
    return max_cnt


